for i in range(0,8):
    plt.subplot(4,2,i+1)
    plt.imshow(x_test[i])    
    
    # previsto [versus] correto
    plt.title("pred:"+category_dict[pred[i]]+"  certo:"+ category_dict[y_test[i][0]])
    plt.axis('off')
    plt.tight_layout(pad=0.8)
plt.show()